import "./task-list.css";
import Task from "../task";

const TaskList = ({ todos }) => {
  const elements = todos.map((item) => {
    return <Task label={todos[0].label} className={todos[0].status} />;
  });

  return (
    <ul className="todo-list">
      <Task label={todos[1].label} className={todos[1].status} />
      <Task label={todos[2].label} />
    </ul>
  );
};

export default TaskList;
